import React from 'react';
import styles from './Ucenik.module.css';

const UcenikRow = ({ id, ime, prezime, birthday, image }) => {
  return (
    <div className={styles.ucenik}>
      <h1>
        {id} {ime} {prezime}
      </h1>
      <hr />
      <p>Birthday: {birthday}</p>
      <img alt="user">{image}</img>
    </div>
  );
};

export default UcenikRow;
